import React from 'react';
import styled from "styled-components";

export const Pic = styled.img`
  margin-top: 5px;
  color : #605f5f;
  font-family: Nanum Barun Gothic;
  font-size : 12px;
  font-weight: bold;
`;

const Profile = () => {
  return (
    <div>
      {/* <Pic src="public/images/profile.png" /> */}
      <img src="public/images/profile.png" alt="1"></img>
    </div>
  );
};

export default Profile;
